import React, { Fragment } from 'react';

import styled from 'styled-components';
import DataForm from '../../styled/DataForm';
import DataField from '../../styled/DataField';
import SendForm from '../../styled/SendForm';

const Container = styled.div`
	padding: 8px;
	background-color: grey;
	position: relative;
`;

const Title = styled.h3`
	letter-spacing: 0.8px;
	color: blue;
`;

const Register = () => {
	return (
		<Fragment>
			<DataForm>
				<Title>Register</Title>
				<DataField>
					<label for='full-name'>Full Name</label>
					<input type='text' id='full-name' />
				</DataField>
				<DataField>
					<label for='email'>Email </label>
					<input type='text' id='email' />
				</DataField>
				<DataField>
					<label for='Password'>Password </label>
					<input type='text' id='Password' />
				</DataField>
				<DataField>
					<label for='Interests'>Password</label>
					<input
						type='text'
						id='Password'
						placeholder='example: sports, local politics'
					/>
				</DataField>
				<SendForm>Submit</SendForm>
			</DataForm>
		</Fragment>
	);
};

export default Register;
